import React from 'react';
import {Button, Container, Grid} from '@mui/material';

const App = () => {
  return (
    <>
      <Container maxWidth={'md'}>
        <Grid container>
          <Grid item xs={6}>
            <Item>
              <Button variant="contained">Hello World</Button>
            </Item>
          </Grid>
          <Grid item xs={6}>
            <Button variant="contained">Hello World</Button>
          </Grid>
        </Grid>
      </Container>
    </>
  );
};

export default App;
